const initialState = {
    items: [
      { id: 0, itemName: 'Item 1', description: 'Description 1', price: '10', image: 'data:image/jpeg;base64,' },
      { id: 1, itemName: 'Item 2', description: 'Description 2', price: '20', image: 'data:image/jpeg;base64,' },
    ],
  };
  
  const reducer = (state = initialState, action) => {
    switch (action.type) {
      case 'ADD_ITEM':
        return {
          ...state,
          items: [...state.items, action.payload],
        };
      case 'DELETE_ITEM':
        return {
            ...state,
            items: state.items.filter((item) => item.id !== action.payload),
          };
      case 'DELETE_ALL_ITEMS':
        return {
          ...state,
          items: [],
        };
      default:
        return state;
    }
  };
  
  export default reducer;
  